description:
Perth Aggressive Post Hardcore band, Dropbears' single 'Absinthe' (192kbps) and Album 'We Are Not Seen By Others' (VBR ~270kbps). They were out of their CDs on bigcartel and this took ages to acquire so I hope you enjoy it.

Boys, you seem to be on top of sites posting your music, want to get it out there to people somehow. As always, please support this band if you like what you listen to.
